  const [searchParams, setSearchParams] = useSearchParams();
  const {lat} = searchParams.get('lat');
  const {lng} = searchParams.get('lat');
  return <div className={styles.mapContainer}>
  Map
  <h1>Position: </h1>
  </div>;
}

export default Map;
